My Tattoo Addiction

Health-Medical Documentary hosted by Julian Barratt, published by Channel 4 in 2012 - English narration


Information
------------------------------

This film explores the world of tattoos; the artists, the reasons why people have them and what happens when they regret them. From a drunken dare to tattoo obsessions, My Tattoo Addiction seeks to discover what people's tattoos say about their lives and tells some of the compelling stories that lie beneath the surface of body art. There are over an estimated 20 million tattoos in Britain and full arm, leg, chest, back and even head tattoos are now more popular than ever.

